          "title": "<p class=\"p1\" style=\"text-align: right; font: 400 16px Arial;\">وحدة الرسائل&nbsp;</p>",
          "text": "<div style=\"direction: rtl;\"><p class=\"p1\" style=\"text-align: right; font: 400 14px Arial;\"><span class=\"Apple-converted-space\">&nbsp;</span>هي الرسائل الجامعية - رسائل الماجستير و الدكتوراة سواء مطبوعة او الكترونية - التي أجيزت من<span class=\"Apple-converted-space\">&nbsp;</span>جامعة الملك عبدالعزيز و بالإضافة الى الرسائل التي تأتي عن طريق الإهداء يتم جمع و تنظيم الرسائل الجامعية المقدمة من طلبة الدراسات العليا، و يتيح للباحثين الاطلاع على هذه الرسائل و الاستفادة منها&nbsp;<span style=\"text-decoration-line: underline; color: rgb(12, 97, 171); font-size: 12px; text-align: center;\">https://libsp.kau.edu.sa/</span></p></div>",
