          "text": "<div><p class=\"p2\" style=\"text-align: right; font: 400 14px Arial;\">المخطوط هو كل ما خط بخط اليد و يحتوي القسم على أقدم مخطوطة و هي حلية الأبرار</p><p class=\"p2\" style=\"text-align: right; font: 400 14px Arial;\">تمثل المخطوطات دورا هاما و حيويا في احياء و توثيق التراث العربي الاسلامي و تفتح افاقا جديدة للبحث و التحقيق العلمي فضلا عن اهميتها التاريخية و الفنية و ما تتضمنه من صور و الوان و زخارف لتبقى شاهدا على عراقة و تقدم الحضارة العربية الاسلامية في مختلف فروع المعرفة البشرية ، و يحتوي القسم على 3215 مخطوطة ورقية منها 2407 مخطوطة اصلية و الباقي صور منسوخة على ورق و جميع تلك المخطوطات مفهرسة على على النظام الالي للإدارة بالإضافة الى فهارس المخطوطات الورقية المطبوعة و المتوفرة بالقسم&nbsp;</p></div>",
